import React, { Component } from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

/*import { Document } from 'react-pdf';
import { pdfjs } from 'react-pdf';
import resume from '../../imgs/resume.pdf';
pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;
*/


class ExperienceContainer extends Component {
	render() {
		return (
			<Container>
				<Row>
					<Col>
						<h1 style={{textAlign:"center"}}>Technical Experience</h1>
					</Col>
				</Row>
				<hr />
				<Row className="justify-content-center-md">
					<Col>
						<p>This page will outline various techical projects and experiences I have taken part in. You may download my Resume on the right.</p>
					</Col>
					<Col>
						<a href="nigelhaney.me/imgs/resume.pdf">Resume</a>
					</Col>
				</Row>
			</Container>
		);
	}
}

export default ExperienceContainer;
